      let ipAddress = 'Test-IP-127.0.0.1';
      try {
        const ipResponse = await fetch('https://api.ipify.org?format=json');
        const ipData = await ipResponse.json();
        ipAddress = ipData.ip;
      } catch (e) {
        console.log('IP capture fallback');
      }
      const signatureTimestamp = new Date().toISOString();
      const signatureInfo = { timestamp: new Date().toLocaleString(), ip: ipAddress };
