          city: REALISTIC_EMPLOYEE.city,
          state: REALISTIC_EMPLOYEE.state,
          zip: REALISTIC_EMPLOYEE.zip,
          filingStatus: REALISTIC_EMPLOYEE.filingStatus,
          multipleJobs: REALISTIC_EMPLOYEE.multipleJobs,
          qualifyingChildren: REALISTIC_EMPLOYEE.qualifyingChildren,
